import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, IconButton, Toolbar } from '@material-ui/core';
import SortIcon from '@mui/icons-material/Sort';
import ArticleIcon from '@mui/icons-material/Article';
import { Collapse } from '@mui/material';

const useStyles = makeStyles((theme) => ({
    main: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
        fontFamily: 'Nunito',
    },

    appbar: {
        background : 'none',
        fontFamily: 'Nunito',

    },

    appbarWrapper: {
        width: '80%',
        margin: '0 auto',
    },

    appbarTitle: {
        flexGrow: '1',
    },

    titlecolor: {
        color: '#C20C27',
    },

    bodycolor: {
        color: '#C20C27',
    },

    container: {
        textAlign: 'center',
    },

    appBody: {
        fontSize: '5.5rem',
       color: '#fff',
   },

    icon: {
        color: '#fff',
        fontSize: '3rem',
    },

    downIcon: {
        fontSize: '5rem',
        color: '#C20C27',

    },
}));


export default function Header() {
    const classes = useStyles();
    const [checked,setChecked] = useState(false);
    useEffect(()=>{
        setChecked(true);
    },[])
return (
    <div className={classes.main}>
        <AppBar className={classes.appbar} elevation={0}>
            <Toolbar className={classes.appbarWrapper}> 
                <h1 className={classes.appbarTitle} > Fibonacci<span className={classes.titlecolor}>DAO.</span> </h1>
                <IconButton>
                    <SortIcon className={classes.icon} />
                </IconButton>
            </Toolbar>
        </AppBar>
            <Collapse
             in={checked} 
             { ... (checked ? { timeout: 1000 } : {})} 
             collapsedHeight={50}> 
                <div className={classes.container}>
            <h1 className={classes.appBody}>
                Welcome to <br />  Fibonacci<span className={classes.titlecolor}>DAO.</span>
             </h1>
            <IconButton href = 'https://fibonaccidao.gitbook.io/api-docs/'>
                <ArticleIcon className={classes.downIcon} />
             </IconButton>
            </div>
        </Collapse>
    </div>
    );
}
